import React from "react";
import { Link } from "react-router-dom";
import { useDispatch } from "react-redux"; // Import useDispatch hook
import { logout } from "../actions/userActions"; // Import logout action

function Dashboard() {
  const dispatch = useDispatch(); // Get the dispatch function

  const handleLogout = () => {
    dispatch(logout()); // Dispatch the logout action
  };

  return (
    <div
      style={{
        position: "relative",
        overflow: "hidden",
      }}
    >
      <div style={{ margin: "24px", overflowY: "auto", height: "100vh" }}>
        {/* Your existing dashboard content */}
      </div>
      <button
        onClick={handleLogout} // Call handleLogout function on button click
        style={{
          cursor: "pointer",
          border: "2px solid rgba(18, 0, 184, 1)",
          backgroundColor: "rgba(18, 0, 184, 1)",
          borderRadius: "5px",
          color: "#ffffff",
          padding: "10px",
          fontSize: "18px",
        }}
      >
        Logout
      </button>
    </div>
  );
}

export default Dashboard;
